import React from 'react';
import {Link} from 'react-router-dom';

const NavigationMenu = props => {
  return(
    <div id="navMenu">
      <Link to="/districts/1/selector">Home</Link>
      <Link to="/districts/1/selector">District Calendar</Link>
      <Link to="/districts/1/selector">School Homepage</Link>
    </div>
  )
}

export default NavigationMenu;
